import React from "react";

export default function Pagination({totalImages, imagesPerPage}) {
    const pageNums = [];

    for (let i = 1; i <= Math.ceil(totalImages / imagesPerPage); i++) {
        pageNums.push(i);
    }

    return (
        <div className="pagination">
            {pageNums.map((num) => {
                return <div className="pagination-num">{num}</div>;
            })}
        </div>
    )
}
